import Root from "./route/Root";
import {CreateUrl, UrlList, WorldsContainer, Signin, Signup} from "./route";
import {ROUTES} from "./constants";

const routes = [
    {
        component: Root,
        routes: [
            {
                path: ROUTES.HOME,
                exact: true,
                component: CreateUrl,
                isPrivatePath: false
            }, {
                path: ROUTES.LIST,
                exact: true,
                component: UrlList,
                isPrivatePath: true
            }, {
                path: ROUTES.WORDS,
                exact: true,
                component: WorldsContainer,
                isPrivatePath: true
            }, {
                path: ROUTES.SIGNIN,
                exact: true,
                component: Signin,
                isPrivatePath: false,
                redirect: true,
            }, {
                path: ROUTES.SIGNUP,
                exact: true,
                component: Signup,
                isPrivatePath: false
            }
        ]
    }
];

export default routes;
